        </Nav.Item>
      </Nav>
    </Col>
    <Col sm={9}>
      <Tab.Content>
        <Tab.Pane eventKey="first">
          
        </Tab.Pane>
        <Tab.Pane eventKey="second">
            
        </Tab.Pane>
        <Tab.Pane eventKey="third">
            
        </Tab.Pane>
      </Tab.Content>
    </Col>
  </Row>
</Tab.Container>
        </div>
        
        
    );

}

export default IamaSitter;
